import React, { Fragment } from "react";

const name = "Carlos";
const edad = 19;
const id = "118380413";

const bandera=true;
const P = () => {
    if(bandera){
        return <p></p>
    }
  return (
    <Fragment>
      <p className="P">{name}</p>
      <p className="P">{edad}</p>
      <p className="P">{id}</p>
    </Fragment>
  );
};

export default P;
